import React from "react";
import "./Header.css";
import SearchIcon from '@mui/icons-material/Search';
function Header() {
return (
<div className="header">
<img className="header__logo" src="http://pngimg.com/uploads/amazon/amazon_PNG11.png"/>


  <div className="header__search">  
    <input className="header__searchInput " type="text "/>
  </div>       
          
          
<div className="header__nav"> </div>
  <div className="header__option">
        <span className="header__optionOrder1"> Hello </span>
        <span className="header__optionOrder2"> Sign In </span>
    </div>

    <div className="header__option">
        <span className="header__optionSearch1"> Return</span>
        <span className="header__optionSearch2"> Order </span>
    </div>

    <div className="header__option">
        <span className="header__optionSearch1">Your </span>
        <span className="header__optionSearch2">Cart
        </span>
    </div>
    </div>
);
}

export default Header;
